import React from 'react'
import './Navbar.css'

function Navbar  () {
  return (
    <nav  className='right navbar-nav navbar-expand navbar-light navbar-bg'>
    <section style={{width:"100%"}} className='navbar-nav'>
      <a href="/" className="navbar-item">Monitoring</a>
      <a href="/product" className="navbar-item">Product</a>
      <a href="/user" className="navbar-item">User</a>
      <a href="/service" className="navbar-item">Service</a>   
    </section>
    </nav>
  )
}
export default Navbar;
